import React from 'react';
import styled from 'styled-components';


const Instagram = () => {

    const Container = styled.div`
        grid-template-columns: 100px 50px 100px;
        grid-template-rows: 80px auto 80px; 
        column-gap: 10px;
        row-gap: 15px;
        justify-content: end; 

        //
        .gallery .gallery-item-1 {
            grid-column-start: 1;
            grid-column-end: 9;
            grid-row-start: 1;
            grid-row-end: 6;
          }
    `
    const ItemOne = styled.div`

            grid-column-start: 1;
            grid-column-end: 9;
            grid-row-start: 1;
            grid-row-end: 6;
          }
    `

    return (
        <Container className='insta-container'>
            <p>jdhfjsn</p>
        </Container>
    )
}

export default Instagram;
